import React from 'react';
import noAvatar from '../image/no-avatar.png'

class UserAvatar extends React.Component{
    render(){
        return(
            <div>
                <div>
                    <img src={noAvatar} alt="avatar"/>
                </div>
            </div>
        )
    }
}

export default UserAvatar;
